import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class SuccessLogin extends Component {
  render() {
    return (
      <div className="successLogin-container">
        <h2>User successfully Logged in!</h2>
      </div>

    )
  }
}

export default SuccessLogin;
